import React from 'react'
import Navbar from "../shared/Navbar";
import Sidebar from "../shared/Sidebar";
function Homepage() {
    return (
        <div>
            <div>
                <Navbar></Navbar>
                <div style={{ display: 'flex' }}>
                    <Sidebar></Sidebar>
                    <h1>hello world</h1>
                </div>

            </div>
        </div>
    )
}

export default Homepage
